-- Encodage
SET NAMES utf8;

-- Suppression des traductions non française
DELETE FROM `gameobject_template_locale` WHERE `locale` NOT IN ('frFR');

-- Définit le français comme langue par défaut
ALTER TABLE `gameobject_template_locale`   
CHANGE `locale` `locale` VARCHAR(4) CHARSET utf8 COLLATE utf8_general_ci DEFAULT 'frFR' NOT NULL;

-- Insertion des gameobjects manquants
INSERT IGNORE INTO `gameobject_template_locale` (`entry`, `castBarCaption`, `VerifiedBuild`) SELECT `entry`, `castBarCaption`, `VerifiedBuild` FROM `gameobject_template`;

